void	test(char *str)
{
	t_bundle	*bundle;

	bundle = create_bundle(str);
	ft_putnbr(bundle->list_a_length);
	ft_putstr(" : ");
	quick_sort(bundle);
	ft_putnbr(bundle->operations_length);
	ft_putstr(" : ");
	if (bundle->is_sorted(bundle))
		ft_putstr("OK\n");
	else
		ft_putstr("KO\n");
	free_bundle(bundle);
}

